DROP TABLE IF EXISTS `APP_FEE_ORDER_INF`;
CREATE TABLE `APP_FEE_ORDER_INF` (
`FIF_ORDERNO`  BIGINT NOT NULL COMMENT '商城请求订单号' ,
`FIF_CHARGE_STATUS`  varchar(2) NULL COMMENT '订单状态(00:初始状态 01:处理中 02:充值完成 03:申请退款未审核 04:退款申请审核通过待复核 05:退款申请拒绝 06:退款成功)' ,
`FIF_NOTICE_PHONE`  varchar(50) NULL COMMENT '通知手机号码' ,
`FIF_ACOUNT_NO`  varchar(50) NULL COMMENT '户号' ,
`FIF_MALLID`  BIGINT NULL COMMENT '商城ID' ,
`FIF_AREA`  varchar(20) NULL COMMENT '缴费区域' ,
`FIF_SUBJECT`  varchar(20) NULL COMMENT '缴费项目' ,
`FIF_PUBLIC_UNIT`  varchar(50) NULL COMMENT '公共事业单位' ,
`FIF_REFUND_REASON`  text NULL COMMENT '退款原因' ,
`FIF_FAILED_REASON`  text NULL COMMENT '充值失败原因' ,
`FIF_ZFB_TRANSFLOW`  varchar(30) NULL COMMENT '充值成功后的支付宝流水号' ,
`FIF_FEEPAYMENT_AMT`  decimal(18,2) NULL COMMENT '水电煤缴费金额' ,
`FIF_FEEPAYMENT_FEE`  decimal(18,2) NULL COMMENT '水电煤手续费' ,
`FIF_DEAL_TIME`  DATETIME NULL COMMENT '处理时间' ,
`FIF_PAY_WAY`  varchar(30) NULL COMMENT '支付方式' ,
`FIF_DEAL_PERSON`  varchar(30) NULL COMMENT '操作员姓名' ,
`FIF_OTHER`  varchar(30) NULL COMMENT '其他' ,
`FIF_DETAIL`  text NULL ,
`FIF_CONTRACTNO`  varchar(30) NULL ,
`FIF_TOTALNUM`  DECIMAL(18,2) NULL ,
PRIMARY KEY (`FIF_ORDERNO`)
)

;

