-- ----------------------------
-- Table structure for IM_FEE_ITEM
-- ----------------------------
DROP TABLE IF EXISTS `IM_FEE_ITEM`;
CREATE TABLE `IM_FEE_ITEM` (
`IFI_TYPE`  char(1) NOT NULL COMMENT '收费类型0:手续费 1:分润' ,
`IFI_ENTITYID`  varchar(20) NOT NULL COMMENT '计费项目所属实体ID，根据类型分别为平台编号和客户编号,平台编号即为0' ,
`IFI_ENTITYNAME`  text NOT NULL COMMENT '计费项目所属实体名称，客户编号为具体客户名称' ,
`IFI_CODE`  varchar(30) NOT NULL COMMENT '计费项目代码，对应于PUB_APPPAR.IM_FEE_TRAN' ,
`IFI_TERM`  char(1) NOT NULL COMMENT '计费期限（0：每月；1：每季；2：每年）PUB_APPPAR.IM_FEEITEM_TERM' ,
`IFI_MODE`  char(1) NOT NULL COMMENT '计费方式（0：按固定金额；1：按交易金额比率；2：金额区间）' ,
`IFI_AMOUNT`  decimal(18,2) NOT NULL COMMENT '计费额度，当按比率收费时为百分比' ,
`IFI_MINAMOUNT`  decimal(18,2) NULL COMMENT '最低费用，指在计费期内收取的最低费用' ,
`IFI_MAXAMOUNT`  decimal(18,2) NULL COMMENT '最高费用，指在计费期内收取的最高费用' ,
`IFI_AMOUNTSTR`  varchar(200) NULL COMMENT '按金额区间方式统计字符串' ,
`IFI_CHARGESET`  char(1) NOT NULL COMMENT '收费标准0:计费设置规则,1:表达式规则' ,
PRIMARY KEY (`IFI_ENTITYID`, `IFI_TYPE`, `IFI_CODE`)
)
COMMENT='计费项目表 '

;

