DROP TABLE IF EXISTS `IM_ITEM`;
CREATE TABLE `IM_ITEM` (
`ITM_ID`  varchar(8) NOT NULL COMMENT '功能编号' ,
`ITM_NAME`  varchar(60) NOT NULL COMMENT '功能名称' ,
