-- ----------------------------
-- Table structure for IM_JUDGE_INF
-- ----------------------------
DROP TABLE IF EXISTS `IM_JUDGE_INF`;
CREATE TABLE `IM_JUDGE_INF` (
`IJF_NO`  varchar(20) NOT NULL COMMENT '流水号 8位日期+12位流水号' ,
`IJF_DATETIME`  varchar(14) NOT NULL COMMENT '发起申请时间' ,
`IJF_CSTNO`  varchar(10) NULL COMMENT '发起客户号' ,
`IJF_CSTTYPE`  varchar(2) NOT NULL COMMENT '发起客户类型' ,
`IJF_TYPE`  varchar(2) NOT NULL COMMENT '仲裁类型（1：申请延期付款仲裁 2：申请退款仲裁）' ,
