`IJF_ORDER_TRANFLOWNO`  varchar(30) NOT NULL COMMENT '订单交易号' ,
`IJF_TEL`  varchar(12) NULL COMMENT '发起申请人的电话' ,
`IJF_REASON`  varchar(100) NULL COMMENT '发起申请原因' ,
`IJF_PIC1`  longblob NULL COMMENT '附件图片' ,
`IJF_PIC2`  longblob NULL COMMENT '附件图片' ,
`IJF_JUDGE_CSTNO`  varchar(10) NULL COMMENT '仲裁人客户号' ,
`IJF_JUDGE_TIME`  varchar(14) NULL COMMENT '仲裁时间' ,
`IJF_CHECK_CSTNO`  varchar(10) NULL COMMENT '仲裁复核人客户号' ,
`IJF_CHECK_TIME`  varchar(14) NULL COMMENT '仲裁复核时间' ,
`IJF_CHECK_REMARK`  varchar(100) NULL COMMENT '仲裁复核意见' ,
PRIMARY KEY (`IJF_NO`)
)

;

