-- Records of IM_JUDGE_INF
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for IM_LOG
-- ----------------------------
DROP TABLE IF EXISTS `IM_LOG`;
CREATE TABLE `IM_LOG` (
`LOG_LOGNO`  char(12) NOT NULL COMMENT '日志编号' ,
`LOG_DATETIME`  char(14) NOT NULL COMMENT '操作时间，格式为YYYYMMDDHHMISS' ,
