`LOG_BSNCODE`  varchar(11) NOT NULL COMMENT '交易代码' ,
`LOG_RESULT`  char(8) NOT NULL COMMENT '操作结果（00000000表示成功，否则为错误代码）' ,
`LOG_CONTEXTID`  varchar(60) NULL COMMENT '交易的context名称' ,
`LOG_INFO`  text NULL COMMENT '操作描述' ,
