-- Records of IM_LOG
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for IM_LOGON_CTRL
-- ----------------------------
DROP TABLE IF EXISTS `IM_LOGON_CTRL`;
CREATE TABLE `IM_LOGON_CTRL` (
`LCL_CSTNO`  varchar(10) NOT NULL COMMENT '客户号，用户的唯一标识 ' ,
`LCL_FIRSTLOGON`  char(14) NULL COMMENT '首次登陆时间，格式为YYYYMMDDHHMISS' ,
`LCL_LASTLOGON`  char(14) NULL COMMENT '上次成功登陆时间，格式为YYYYMMDDHHMISS' ,
`LCL_LASTFAIL`  char(8) NULL COMMENT '上次登陆失败日期，格式为YYYYMMDD' ,
`LCL_FAILTODAY`  decimal(65,30) NOT NULL COMMENT '当日连续登陆失败次数' ,
`LCL_FAILSUM`  decimal(65,30) NOT NULL COMMENT '总计连续登陆失败次数  ' ,
`LCL_COUNT`  decimal(65,30) NOT NULL COMMENT '总成功登陆次数' ,
`LCL_FREEZEDATE`  char(8) NULL COMMENT '冻结日期，格式为YYYYMMDD' ,
`LCL_STOPSTART`  char(8) NULL COMMENT '停用日期，格式为YYYYMMDD' ,
`LCL_STOPEND`  char(8) NULL COMMENT '起用日期，格式为YYYYMMDD（如果99990101是指永久停用）' ,
`LCL_FAILAUTH`  decimal(65,30) NOT NULL COMMENT '连续输入授权密码错误次数' ,
