DROP TABLE IF EXISTS `PUB_EMAIL_CTRL`;
CREATE TABLE `PUB_EMAIL_CTRL` (
`EIC_CSTNO`  varchar(16) NOT NULL COMMENT '客户号' ,
`EIC_CSTTYPE`  varchar(2) NOT NULL COMMENT '客户类型 P个人 C企业 M商户' ,
`EIC_EMAIL`  varchar(255) NOT NULL COMMENT '发送邮件邮箱' ,
`EIC_VERSION`  decimal(10,0) NULL COMMENT '版本号' ,
`EIC_BUSCODE`  varchar(10) NOT NULL COMMENT '交易码 00激活邮件发送次数  10激活成功邮件发送次数  20账户修改成功邮件发送次数  30支付密码找回发送次数 31登陆密码找回发送次数  40开通邮箱登陆通知次数' ,
`EIC_USETIME`  varchar(14) NOT NULL COMMENT '使用时间' ,
`EIC_COUNT`  decimal(10,0) NOT NULL COMMENT '发送邮件次数' ,
PRIMARY KEY (`EIC_CSTNO`, `EIC_CSTTYPE`, `EIC_BUSCODE`)
)
COMMENT='邮件发送控制表 '

;

